import React from "react";
import Creams from "./Creams";
import { Link } from "react-router-dom";

const Foods = (props) => {
  return (
    <>
      {props.foods.map((foods, id) => (
        <Link to={`/blogs/${foods.id}`}>
          <Creams key={id} foods={foods} />
        </Link>
      ))}
    </>
  );
};

export default Foods;
